import React, { useState, useEffect } from 'react';
import { Box, Heading, Text, Button, Stack, Flex, Grid } from '@chakra-ui/react';
import { useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';

// Define the prop type for userType
interface DashboardProps {
  userType: number;  // Explicitly declare userType as a number
}

const Dashboard: React.FC<DashboardProps> = ({ userType }) => {
  const navigate = useNavigate();  // Hook for logout navigation
  const location = useLocation();  // Hook to access state from Login page

  // Destructure the data passed via state
  const { statusCode, fullName, userId } = location.state || {};

  // State to hold the student's enrollments
  const [enrollments, setEnrollments] = useState<any[]>([]);

  // Fetch enrollments data on component mount
  useEffect(() => {
    const fetchEnrollments = async () => {
      try {
        const response = await axios.get('http://localhost:5000/GetAllEnrollments');
        // Filter enrollments based on the student's name (fullName)
        const studentEnrollments = response.data.data.filter((enrollment: any) => enrollment.studentName === fullName);

        // Process each enrollment to add a progress field based on completionStatus
        const processedEnrollments = studentEnrollments.map((enrollment: any) => {
          let progress = 0;
          if (enrollment.completionStatus === "1") {
            progress = 100;  // Completed course
          } else {
            progress = Math.floor(Math.random() * (90 - 20 + 1)) + 20;  // Random progress between 20% and 90%
          }
          return {
            courseName: enrollment.courseName,
            completionStatus: enrollment.completionStatus,
            progress,
          };
        });

        // Update state with the processed enrollments, limit to max 3 enrollments
        setEnrollments(processedEnrollments.slice(0, 3)); // Max 3 subjects
      } catch (error) {
        console.error('Error fetching enrollments:', error);
      }
    };

    fetchEnrollments();
  }, [fullName]);

  // Logout handler function
  const handleLogout = () => {
    navigate('/');  // Navigate back to the login page
  };

  return (
    <Flex
      height="100vh" // Full height of the viewport
      width="100vw"  // Full width of the viewport
      align="center"
      justify="center"
      bg="gray.50"
      p={6}
    >
      <Box
        p={8}
        maxWidth="1200px"  // Optionally, you can limit the max width of the content
        width="100%"        // Ensure it takes full width within the viewport
        borderWidth={1}
        borderRadius={8}
        boxShadow="lg"
        bg="white"
      >
        {/* Conditionally render the dashboard title based on userType */}
        <Heading as="h2" size="xl" mb={6} textAlign="center">
          {userType === 1 ? 'Admin Dashboard' : 'Student Dashboard'}
        </Heading>
        <Heading as="h6" size="l" mb={5} textAlign="center">
          User ID: {userId}, <i><b>{fullName}</b></i>
        </Heading>

        <Stack spacing={6}>
          <Text fontSize="xl">Welcome back <b>{fullName}</b>. Here's an overview of your current activities:</Text>

          {/* Section for Current Enrollments */}
          <Box>
            <Heading as="h3" size="md" mb={4}>
              Your Active Classes
            </Heading>
            <Grid templateColumns="repeat(3, 1fr)" gap={6} justifyContent="center" alignItems="center">
              {/* Dynamically render the enrolled classes */}
              {enrollments.length > 0 ? (
                enrollments.map((enrollment, index) => (
                  <Box
                    key={index}
                    p={4}
                    borderWidth={1}
                    borderRadius={8}
                    bg="teal.100"
                    textAlign="center" // Center the text inside the box
                  >
                    <Heading size="sm">{enrollment.courseName}</Heading>
                    <Text mt={2}>Progress: {enrollment.progress}%</Text>
                  </Box>
                ))
              ) : (
                <Text>No active classes found.</Text>
              )}
            </Grid>
          </Box>

          {/* Section for Available Classes */}
          <Box>
            <Heading as="h3" size="md" mb={4}>
              Available Classes
            </Heading>
            <Button colorScheme="teal" size="md">
              View Available Classes
            </Button>
          </Box>

          {/* Logout Button */}
          <Flex justifyContent="flex-end">
            <Button colorScheme="red" size="md" onClick={handleLogout}>
              Logout
            </Button>
          </Flex>
        </Stack>
      </Box>
    </Flex>
  );
};

export default Dashboard;
